import React, { useState } from 'react';

const About = () => {
  const [selectedImage, setSelectedImage] = useState(null);

  const siteInspectionImages = [
    '/uploads/Site Inspection/OUR SITE INSPECTED BY DISTRICT COLLECTOR1.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY DISTRICT COLLECTOR2.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY DISTRICT COLLECTOR3.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY DISTRICT COLLECTOR4.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR1.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR2.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR3.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR4.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR5.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR6.jpg',
    '/uploads/Site Inspection/OUR SITE INSPECTED BY STATE QUALITY MONITOR7.jpg'
  ];

  return (
    <div className="container">
      {/* Cover Image */}
      <section style={{ marginBottom: '3rem' }}>
        <img 
          src="/uploads/ABOUT US cover pic/TOP IMAGE.jpg" 
          alt="About Us Cover"
          style={{
            width: '100%',
            height: '300px',
            objectFit: 'cover',
            borderRadius: '10px'
          }}
        />
      </section>

      <section className="page-section">
        <h1 className="section-title">About {process.env.REACT_APP_COMPANY_NAME || 'Sathguru Babaji Traders'}</h1>
        <div className="section-content">
          <p>We are one of the Leading Government Road Contractors, Private Layout Developers, and Building Material Suppliers in the region.</p>
          
          <div style={{ marginTop: '2rem' }}>
            <h3>Our Expertise</h3>
            <p>With extensive experience in construction and infrastructure development, we have been successfully executing BT work for:</p>
            <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
              <li style={{ marginBottom: '0.5rem' }}>Highways</li>
              <li style={{ marginBottom: '0.5rem' }}>DRDA</li>
              <li style={{ marginBottom: '0.5rem' }}>Municipality</li>
              <li style={{ marginBottom: '0.5rem' }}>Town Panchayat</li>
              <li style={{ marginBottom: '0.5rem' }}>Village Panchayat</li>
              <li style={{ marginBottom: '0.5rem' }}>Private Layout Development</li>
            </ul>
          </div>

          <div style={{ marginTop: '2rem' }}>
            <h3>Our Mission</h3>
            <p>To provide comprehensive construction solutions with top-notch quality, timely completion, and affordable pricing. From groundwork to finishing, we ensure excellence in every project we undertake.</p>
          </div>

          {/* Site Inspection Gallery */}
          <div style={{ marginTop: '3rem' }}>
            <h3>Site Inspections & Quality Assurance</h3>
            <p>Our work is regularly inspected and approved by government authorities and quality monitors:</p>
            <div style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
              gap: '1rem',
              marginTop: '1rem'
            }}>
              {siteInspectionImages.map((image, index) => (
                <div 
                  key={index} 
                  style={{
                    cursor: 'pointer',
                    borderRadius: '8px',
                    overflow: 'hidden',
                    boxShadow: '0 2px 8px rgba(0,0,0,0.1)'
                  }}
                  onClick={() => setSelectedImage(image)}
                >
                  <img 
                    src={image} 
                    alt={`Site inspection ${index + 1}`}
                    style={{
                      width: '100%',
                      height: '200px',
                      objectFit: 'cover'
                    }}
                  />
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>

      {/* Image Modal */}
      {selectedImage && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          backgroundColor: 'rgba(0,0,0,0.8)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          zIndex: 1000
        }} onClick={() => setSelectedImage(null)}>
          <img 
            src={selectedImage} 
            alt="Enlarged view"
            style={{
              maxWidth: '90%',
              maxHeight: '90%',
              objectFit: 'contain'
            }}
          />
        </div>
      )}
    </div>
  );
};

export default About;
